// 代码中会兼容本地 service mock 以及部署站点的静态数据
import { delay } from 'roadhog-api-doc';

const proxy = {
  'POST /api/register': (req, res) => {
    let temp = new Date().getTime()%2;
    if(temp==0){
      res.send({ status: 'fail', errorMessage: 'user already exists' });
    }else{
      res.send({ status: 'success' });
    }
  },
  'POST /api/resetpassword': (req, res) => {
    res.send({ status: 'success' });
  },
  'GET /qrLogin/check': (req, res) => {
    let temp = new Date().getTime()%3;
    if(temp==0||temp==1){
      res.send({ status: 'fail' });
    }else{
      res.send({ status: 'http://baidu.com'});
    }
  },
  'GET /qrLogin/getQr': (req, res) => {
    res.send({ status: 'success', randomUUID:'1f266e25-a019-44e9-94dd-a741e299e2f9',imgData:'' });
  },
};

// 调用 delay 函数，统一处理
export default delay(proxy, 3000);